import styled from "styled-components"

export  const Main = styled.div`
    padding: 10px;
    height: 100vh;
    width: 100%;
    align-items: center;
    display: flex;
    flex-direction: column;
    form{
        margin-top:  50px;
        display: flex;
        width: 90%;
        height: 50%;
        justify-content: space-evenly;
        flex-direction: column;
    }
    p{
        font-size: 1rem;
    }

`
